--
-- Name: view_data_options; Type: MATERIALIZED VIEW; Schema: public; Owner: akvo
--

CREATE MATERIALIZED VIEW public.view_data_options AS
 SELECT row_number() OVER (PARTITION BY true::boolean) AS id,
    tmp.data_id,
    d.administration_id,
    d.form_id,
    to_jsonb(array_agg(concat(tmp.question_id, '||', lower(tmp.options)))) AS options
   FROM (( SELECT a.data_id,
            a.question_id,
            a.id AS answer_id,
            jsonb_array_elements_text(a.options) AS options
           FROM (public.answer a
             LEFT JOIN public.question q ON ((q.id = a.question_id)))
          WHERE ((q.type = 5) OR (q.type = 6))) tmp
     LEFT JOIN public.data d ON ((d.id = tmp.data_id)))
  GROUP BY tmp.data_id, d.administration_id, d.form_id
  WITH NO DATA;


ALTER TABLE public.view_data_options OWNER TO akvo;

--
-- Name: view_jmp_criteria; Type: MATERIALIZED VIEW; Schema: public; Owner: akvo
--

CREATE MATERIALIZED VIEW public.view_jmp_criteria AS
 SELECT row_number() OVER (PARTITION BY true::boolean) AS id,
    qa.form_id,
    split_part(qa.name, '|'::text, 1) AS name,
    split_part(qa.name, '|'::text, 2) AS level,
    split_part(qa.name, '|'::text, 4) AS group_name,
    (split_part(qa.name, '|'::text, 3))::integer AS score,
    jsonb_agg(qa.option) AS criteria
   FROM ( SELECT q.name,
            qs.form_id,
            q.question_id,
            concat(q.question_id, '||', lower(jsonb_array_elements_text(q.options))) AS option
           FROM (public.question_attribute q
             LEFT JOIN public.question qs ON ((q.question_id = qs.id)))
          WHERE (q.attribute = 4)) qa
  GROUP BY qa.form_id, qa.name
  ORDER BY qa.name
  WITH NO DATA;


ALTER TABLE public.view_jmp_criteria OWNER TO akvo;

--
-- Name: view_jmp_data; Type: MATERIALIZED VIEW; Schema: public; Owner: akvo
--

CREATE MATERIALIZED VIEW public.view_jmp_data AS
 SELECT row_number() OVER (PARTITION BY true::boolean) AS id,
    d.data_id,
    a.path,
    d.form_id,
    c.name,
    c.level,
    c.score,
    count(*) AS matches
   FROM (((public.view_data_options d
     LEFT JOIN public.view_jmp_criteria c ON ((c.form_id = d.form_id)))
     LEFT JOIN public.data dt ON ((dt.id = d.data_id)))
     LEFT JOIN public.administrator a ON ((dt.administration_id = a.id)))
  WHERE (d.options ?| (translate((c.criteria)::text, '[]'::text, '{}'::text))::text[])
  GROUP BY d.data_id, a.path, d.form_id, c.name, c.level, c.score
  ORDER BY d.data_id, d.form_id, c.name, c.level
  WITH NO DATA;


ALTER TABLE public.view_jmp_data OWNER TO akvo;

--
-- Name: view_jmp_count; Type: MATERIALIZED VIEW; Schema: public; Owner: akvo
--

CREATE MATERIALIZED VIEW public.view_jmp_count AS
 SELECT row_number() OVER (PARTITION BY true::boolean) AS id,
    d.form_id,
    d.path,
    d.name,
    d.level,
    count(d.data_id) AS total
   FROM (public.view_jmp_data d
     LEFT JOIN ( SELECT vjc.form_id,
            vjc.name,
            vjc.level,
            count(vjc.id) AS count
           FROM public.view_jmp_criteria vjc
          GROUP BY vjc.form_id, vjc.name, vjc.level) c ON (((c.form_id = d.form_id) AND (c.name = d.name) AND (c.level = d.level))))
  WHERE (d.matches = c.count)
  GROUP BY d.form_id, d.name, d.path, d.level, d.matches
  ORDER BY d.form_id, d.name DESC
  WITH NO DATA;


ALTER TABLE public.view_jmp_count OWNER TO akvo;

--
-- Name: view_options; Type: MATERIALIZED VIEW; Schema: public; Owner: akvo
--

CREATE MATERIALIZED VIEW public.view_options AS
 SELECT row_number() OVER (PARTITION BY true::boolean) AS id,
    a.id AS answer_id,
    a.administration_id,
    a.form_id,
    a.data_id,
    a.question_id,
    replace((o.name)::text, '"'::text, ''::text) AS options
   FROM ( SELECT aw.id,
            aw.name,
            aw.value,
            aw.options,
            aw.created,
            aw.updated,
            aw.created_by_id,
            aw.data_id,
            aw.question_id,
            d.administration_id,
            d.form_id
           FROM (public.answer aw
             LEFT JOIN public.data d ON ((d.id = aw.data_id)))) a,
    LATERAL json_array_elements((a.options)::json) WITH ORDINALITY o(name, rid)
  WHERE (a.options IS NOT NULL)
  WITH NO DATA;


ALTER TABLE public.view_options OWNER TO akvo;

--
-- Name: view_pending_approval; Type: VIEW; Schema: public; Owner: akvo
--

CREATE VIEW public.view_pending_approval AS
SELECT
    NULL::bigint AS id,
    NULL::integer AS status,
    NULL::bigint AS user_id,
    NULL::bigint AS level_id,
    NULL::bigint AS batch_id,
    NULL::bigint AS pending_level;


ALTER TABLE public.view_pending_approval OWNER TO akvo;

