--
-- Name: view_pending_approval _RETURN; Type: RULE; Schema: public; Owner: akvo
--

CREATE OR REPLACE VIEW public.view_pending_approval AS
 SELECT DISTINCT pa.id,
    pa.status,
    pa.user_id,
    pa.level_id,
    pa.batch_id,
    COALESCE(max(pa2.level_id), (0)::bigint) AS pending_level
   FROM (public.pending_data_approval pa
     LEFT JOIN ( SELECT pda.id,
            pda.status,
            pda.user_id,
            pda.level_id,
            pda.batch_id
           FROM public.pending_data_approval pda
          WHERE (pda.status = ANY (ARRAY[1, 3]))) pa2 ON ((pa2.batch_id = pa.batch_id)))
  GROUP BY pa.id;


